import React from "react";
import '../blog.css'
import '../logo.svg'
import { makeStyles } from '@material-ui/core/styles';
import Box from "@material-ui/core/Box";
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import blog_img from'../blog.jpg'
const useStyles = makeStyles((theme) => ({
    appBar: {
        backgroundColor: "#fff"
    },
    blog: {
        backgroundImage: `linear-gradient(rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.5)), url('https://images.unsplash.com
        /photo-1558981852-426c6c22a060?ixlib=rb-1.2.1&
        ixid=eyJhcHBfaWQiOjEyMDd9&w=1000&q=80')`
    }
}));
function Appbar(){
    const classes = useStyles();
    return(
        <div className="App">
            <AppBar className={classes.appBar} position="static">
                <Toolbar>
                    <IconButton  edge="start" color="inherit" aria-label="menu">
                        <MenuIcon color={'primary'} />
                    </IconButton>
                    <Typography color={'primary'} variant="h6">
                        Blog
                    </Typography>
                </Toolbar>
            </AppBar>
            <Box className={classes.blog}>
                <Box>

                </Box>
            </Box>
        </div>
    )
}
export default Appbar;
